import React,{useState} from "react";
import cookieCutter from 'cookie-cutter'
import Navbar from "../../components/navbar";
import {FilledInput, FormControl, InputAdornment, InputLabel} from "@material-ui/core";

interface Picture {
    preview: string;
    raw: string;
}

export default function UploadPost() {
    const [title, setTitle] = useState<string>("");
    const [content, setContent] = useState<string>("");
    const [pictures, setPicture] = useState<Picture[]>([]);

    return (
        <>
            <Navbar />
            <FormControl fullWidth  variant="filled">
                <InputLabel htmlFor="filled-adornment-amount">Title</InputLabel>
                <FilledInput
                    id="filled-adornment-amount"
                />
                <InputLabel htmlFor="filled-adornment-amount">Content</InputLabel>
                <FilledInput
                    id="filled-adornment-amount"
                />
            </FormControl>
        </>
    )
}
